import React from 'react';
import style from 'styled-components';

const StyledIndexPage = style.div`
	display: flex;
	height: 100%;
`

const StyledBlockRole = style.div`
	display: flex;
	background: #E5E5E5;
	background: linear-gradient(180deg, #924FD1 35%, #5454E2 100%);
	justify-content;
	height: 100%;
	width: 50%;

	/* Heading 1 */

	font-family: Roboto;
	font-style: normal;
	font-weight: 500;
	font-size: 48px;
	line-height: 54px;
	/* identical to box height, or 112% */


	color: #FFFFFF;
`

const BlockRole = ( { role } ) => {
	return(
		<StyledBlockRole>
			<h1>
			{role}
			</h1>
		</StyledBlockRole>
	)
}

const IndexPage = () => {
	return(
		<StyledIndexPage>
			<BlockRole role="avtor" />
			<BlockRole role="redarctor"/>
		</StyledIndexPage>
	)
}

export default IndexPage
